const Dashboard = (props) => {
    const { users } = props;
    //const[page, setPage]=React.useState(0);
    const [listEtudiant, setListEtudiant] = React.useState ([]);
    const [searchKey, setSearchKey] = React.useState("");
    const searchChange = (e) => {
      setSearchKey(e.target.value)
    }

    const filteredList = (data)=>{
      return data.filer((etudiant)=> {
        if(searchKey === "") {
          return etudiant;
        }
        else if( (etudiant.firstName.toLoweCase().includes(searchKey.toLocaleLowerCase())) || (etudiant.lastName.toLoweCase().includes(searchKey.toLocaleLowerCase())) ) {
          return etudiant;
        }
      })
    }
  //const [rowsPerPage, setRowsPerPage] = React.useState(10);

  /*const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };*/

  /*const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(+event.target.value);
    setPage(0);
    };*/
    const  getEtudiant = () => {
       axios.get("http://localhost:8080/etudiant",
           {
           headers:{"token":`Bearer ${getToken ()}` }
       })
            .then(res => {
                setListEtudiant(res.data)
                //console.log(listEtudiant)
            })
            .catch(err => {
                console.log(err);
            })
    }
    React.useEffect (() =>
        getEtudiant(),
        []
    )
    //console.log(props);
    return (
        <>
            <SideBar/>
      <div className="tablestyle">
    <Paper sx={{ width: '100%', overflow: 'hidden' }}>
    <Search>
            <SearchIconWrapper>
              <SearchIcon />
            </SearchIconWrapper>
            <StyledInputBase
              placeholder="Search…"
              inputProps={{ 'aria-label': 'search' }}
            />
          </Search>
      <TableContainer sx={{ maxHeight: 700 }}>
        <Table stickyHeader aria-label="customized table">
          <TableHead>
            <TableRow>
                <TableCell>
                    Firstname
                </TableCell>
                <TableCell>
                    Lastname
                </TableCell>
                <TableCell>
                    Date Naissance
                </TableCell>
                <TableCell>
                     note1
                </TableCell>
                <TableCell>
                     note2
                </TableCell>
                <TableCell>
                     moyenne
                </TableCell>
                <TableCell>
                    Détail
                </TableCell>                     
            </TableRow>
          </TableHead>

            {listEtudiant
              .map(index => (
                  <TableBody>

                  <TableRow>

                        <TableCell>
                          {index.firstName}
                          </TableCell>
                          <TableCell>
                          {index.lastName}
                          </TableCell>
                          <TableCell>
                          {index.dateNaissance}
                          </TableCell>
                          <TableCell>
                          {index.note1}
                          </TableCell>
                          <TableCell>
                          {index.note2}
                          </TableCell>
                          <TableCell>
                          {index.moyenne}
                          </TableCell>
                         <TableCell>
                            {/*pathname: `/edit/${index.id}`,*/}
                                    <Link
                                        to={{

                                            pathname: `/edit/${index.idEtu}`,
                                            state: { index }
                                        }}
                                    >
                                      <Fab color="secondary" aria-label="edit">
                                        <EditIcon />
                                      </Fab>
                                    </Link>

                                    <Link
                                        to={{
                                            pathname: "/delete",
                                            state: { index }
                                        }}
                                    >
                                    <i
											className="icofont-ui-delete"
											style={{ color: "red", fontSize: 20 }}
									    />
                                    </Link>

                        </TableCell>  
                      </TableRow>

                  </TableBody>

                  ))}
        </Table>
      </TableContainer>
                </Paper>
                <div>
                    {/*console.log(listEtudiant[0])*/}
                </div>
            </div>
            </>
  );
}
export default Dashboard;
